function g_isWechatClient() {
    var ua = navigator.userAgent.toLowerCase();
    return (/micromessenger/.test(ua)) ? true : false;
}

function g_attachEvent(elem, name, handler) {
    if (elem.addEventListener) {
        elem.addEventListener(name, handler, false);
        this.wxReady = true;
    } else if (elem.attachEvent) {
        elem.attachEvent(name, handler);
        elem.attachEvent('on' + name, handler);
        this.wxReady = true;
    }
}

/**
 *  get query parameters
 */
function g_getQueryParams() {
    var params = {};
    if (!window.location.search) {
        return params;
    }
    var query = window.location.search.substring(1);
    var vars = query.split('&');

    for (var i = 0; i < vars.length; i++) {
        var index = vars[i].indexOf('=');
        if (index > 0) {
            params[vars[i].slice(0, index)] = decodeURIComponent(vars[i].substring(index + 1));
        }
    }
    return params;
}

function g_getUrl(baseurl, params, hash) {
    var qs = '';
    for (var i in params) {
        qs += '&' + i + '=' + encodeURIComponent(params[i]);
    }
    qs = qs.slice(1);
    qs = '?' + qs;
    var url = baseurl + qs + (hash || '');
    return url
}

function g_filterBy(name, value) {
    var params = g_getQueryParams();
    params.page = 1;
    params[name] = value;
    location.href = g_getUrl('', params, location.hash);
}

function g_disableContextMenu() {
    document.oncontextmenu = function(e) {
        return false
    }
    document.onmousedown = function(e) {
        if (e.button == 2 || e.button == 3) {
            e.cancelBubble = true
            e.returnValue = false;
            return false;
        }
    }
}

function g_base64ToBlob(data, mime) {

    var base64 = data.replace(/^data:image\/(png|jpg);base64,/, "")
    mime = mime || '';
    var sliceSize = 1024;
    var byteChars = window.atob(base64);
    var byteArrays = [];

    for (var offset = 0, len = byteChars.length; offset < len; offset += sliceSize) {
        var slice = byteChars.slice(offset, offset + sliceSize);

        var byteNumbers = new Array(slice.length);
        for (var i = 0; i < slice.length; i++) {
            byteNumbers[i] = slice.charCodeAt(i);
        }

        var byteArray = new Uint8Array(byteNumbers);

        byteArrays.push(byteArray);
    }

    return new Blob(byteArrays,{
        type: mime
    });
}

function g_uploadBase64(url, data, cb) {

    var formData = new FormData();
    var blob;
    for (var i in data) {
        blob = g_base64ToBlob(data[i], 'image/png');
        formData.append(i, blob);
    }

    $.ajax({
        url: url,
        type: "POST",
        cache: false,
        contentType: false,
        processData: false,
        data: formData
    }).done(function(data) {
        return cb(null, data);
    }).fail(function(ex) {
        return cb(ex);
    });
}

function g_getCurrentUrl() {
    return location.pathname + location.search + location.hash;
}

/**
 *  get timespans for time selector
 */
function g_getTimeSpans() {
    var timespans = [];
    for (var i = 0; i < 24; i++) {
        var h = ('00' + i).slice(-2);
        timespans.push(h + ':00');
        timespans.push(h + ':15');
        timespans.push(h + ':30');
        timespans.push(h + ':45');
    }
    return timespans;
}

function g_parseISOLocal(s) {
    var b = s.split(/\D/);
    return new Date(b[0],b[1] - 1,b[2],b[3] || 0,b[4] || 0,b[5] || 0);
}

function g_getDistance(lat1, lng1, lat2, lng2) {
    var radLat1 = lat1 * Math.PI / 180.0;
    var radLat2 = lat2 * Math.PI / 180.0;
    var a = radLat1 - radLat2;
    var b = lng1 * Math.PI / 180.0 - lng2 * Math.PI / 180.0;
    var s = 2 * Math.asin(Math.sqrt(Math.pow(Math.sin(a / 2), 2) + Math.cos(radLat1) * Math.cos(radLat2) * Math.pow(Math.sin(b / 2), 2)));
    s = s * 6378.137;
    // EARTH_RADIUS;
    s = Math.round(s * 10000) / 10000;
    return s;
}

